soup = BeautifulSoup(my_html, 'html.parser')

soup_2 = BeautifulSoup(my_html_2, 'html.parser')


def is_bestseller(soup):

    el = soup.find("th", string=" Best Sellers Rank ").parent

    string_found = str(el)
    string_split = string_found.split()
    res = 0

    for i, elt in enumerate(string_split):
        if (elt == 'in') and ("span" in string_split[i-1]):
            res = int(string_split[i-1][-1])

    #print('elt: ', el)
    print('string: ', string_found)
    print('res ', res)

# Function to extract Product Rating
def get_rating(soup):

	try:
		rating = soup.find("i", attrs={'class':'a-icon a-icon-star a-star-4-5'}).string.strip()
		
	except AttributeError:
		
		try:
			rating = soup.find("span", attrs={'class':'a-icon-alt'}).string.strip()
		except:
			rating = ""	

	return rating

print('stars:', get_rating(soup))

def get_review_count(soup):
	try:
		review_count = soup.find("span", attrs={'id':'acrCustomerReviewText'}).string.strip()
		
	except AttributeError:
		review_count = ""	

	return review_count

print('reviews number: ', get_review_count(soup))

def is_bestseller_tr (soup):
    tr_elements = soup.find_all('tr')
	
    res = []

    for i, tr in enumerate(tr_elements):
        if 'Best Sellers Rank' in str(tr):
                res.append(str(tr))
			
    string_split = res[0].split()
    res = ''

    for i, elt in enumerate(string_split):
            if (elt == 'in') and ("span" in string_split[i-1]):
                res = ''
                for x in string_split[i-1]:
                    if x.isdigit() == True:
                        res+=x

    res = int(res)

    return res < 11
	
print(is_bestseller_tr(soup_2))
